function l(t,n="YYYY-MM-DD HH:mm:ss"){if(!t)return"";const e=typeof t=="string"?new Date(t):t;if(isNaN(e.getTime()))return t;const o=e.getFullYear(),c=e.getMonth()+1,a=e.getDate(),p=e.getHours(),Y=e.getMinutes(),g=e.getSeconds(),s=r=>r<10?"0"+r:r;return n.replace("YYYY",o).replace("MM",s(c)).replace("DD",s(a)).replace("HH",s(p)).replace("mm",s(Y)).replace("ss",s(g))}export{l as f};
